def slidingwindowsegment(x, y, create_segment, compute_error, max_error, seq_range=None):
	"""
		Return a list of line segments that approximate the sequence.

		This list is computed by using the sliding window method.

		Parameters
		-----------------------
		x, y: represent the time series to segment
		create_segment: a function of two arguments that returns a line segment that
		approximates the sequence data
		compute_error:
		max_error: the maximum allowable line segment fitting error
	"""
	result_segment = None
	result_time = []
	result_sequence = []
	time = []
	sequence = []
	error = 0
	length = 0
	i = 0
	while (i < len(x)):
		time.append(x[i])
		sequence.append(y[i])
		length += 1
		if (length <= 1):
			continue
		segment = create_segment(time, sequence)
		error = compute_error(time, sequence, length)
		if error < max_error:
			result_segment = segment
			i += 1
			continue
		else:
			if len(result_time) == 0:
				result_time += [result_segment[0], result_segment[2]]
				result_sequence += [result_segment[1], result_segment[3]]
			else:
				result_time += [result_segment[2]]
				result_sequence += [result_segment[3]]

			time = []
			sequence = []
			length = 0
			error = 0
	if length != 0:
		result_segment = segment
		result_time += [result_segment[2]]
		result_sequence += [result_segment[3]]

	return result_time, result_sequence


